import {global} from '../../context/Context'

const Nav=()=> {
const {login} = useContext(global)

  return (
    <div className="navbar  justify-end px-4 shadow-lg " data-theme="acid">
  <div className="flex-1">
    <a className="btn btn-ghost normal-case text-xl">daisyUI</a>
  </div>
  <div class="flex-none">

    </div>
    <div className="dropdown dropdown-end">
      <label tabIndex={0} className="btn btn-ghost btn-circle avatar">

        {
          login ? (<button>Login</button>): (
            <div className="w-10 rounded-full border-2 border-red-500 flex items-center justify-center">
            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor" className="w-6 h-6">
  <path strokeLinecap="round" strokeLinejoin="round" d="M15.75 6a3.75 3.75 0 11-7.5 0 3.75 3.75 0 017.5 0zM4.501 20.118a7.5 7.5 0 0114.998 0A17.933 17.933 0 0112 21.75c-2.676 0-5.216-.584-7.499-1.632z" />
</svg>
</div>

          )
        }

      </label>
      <ul tabIndex={0} className="menu menu-compact dropdown-content mt-3 p-2 shadow bg-base-100 rounded-box w-52">
        <li>
          <a className="justify-between font-bold">
            Welcome

          </a>
        </li>
        <li ><a>Logout</a></li>
      </ul>
    </div>
  </div>

  );
}

export default Nav;
